import Joi          from '@hapi/joi';
import eventService from '../services/events';

const joiSchema = Joi.object().keys({
    name: Joi.string().min(3).required(),
    start: Joi.date().iso().required(),
    end: Joi.date().iso().required()
});

const getAll = async (req, res, next) => {
    try {
        var events = await eventService.getAll();
    } catch (err) {
        req.log.error(err);
        return next(err);
    }

    return res.json(events);
};

const create = async (req, res, next) => {
    const body = {
        name: req.body.name,
        start: new Date(req.body.start),
        end: new Date(req.body.end),
        user_id: req.user.id
    };

    try {
        var event = await eventService.create(body);
    } catch (err) {
        req.log.error(err);
        return next(err);
    }

    return res.json(event);
};

const addEventToReq = async (req, res, next) => {
    const id = req.params.id;

    try {
        var event = await eventService.getById(id);
    } catch (err) {
        /* istanbul ignore else  */
        if (err.name == 'EVENT_NOT_FOUND') {
            const error = {
                code: 404,
                message: `[Not Found]\nEvent with id ${id} not found.`
            };

            req.log.warn(error);
            return res.status(404).json(error);
        } else {
            req.log.error(err);
            return next(err);
        }
    }

    req.event = event;

    return next();
};

const getById = async (req, res, next) => {
    if (!req.event) {
